    [],nt"revision_timestamp": "2016-10-27T18:56:18.123953",nt"name": "wetland-restoration-and-sediment-removal",nt"isopen":
    false,nt"url": null,nt"notes": "In 2008, Minnesotau2019s Private Lands
    Program and Wetland Management Districts began to compare different methods of restoring
    prairie pothole wetlands to see if there are differences in wetland quality long-term.
    The top layer of soil in a degraded wetland has washed into the basin from the adjacent
    uplands and contains weed seeds.  We incorporated removing sediment into the restoration
    and compared it with simply restoring hydrology (plugging ditches and breaking tile
    lines). u00a0By recording the details of when, where, and how these wetlands were
    restored and whether or not sediment was removed as part of the restoration process,
    we are able to monitor the habitat quality of the wetlands as they mature and retrospectively
    evaluate our restoration methods. u00a0We are using an adaptive management framework
    that employs predictive models and statistical methods that allow us to learn a
    little bit from every wetland that is monitored.",nt"license_title": "License
